<script setup>
import {nextTick, ref, onMounted, onUnmounted, computed} from 'vue'
import { useRouter, useRoute, onBeforeRouteUpdate } from 'vue-router'
const router = useRouter()

import gsap from 'gsap'

const svg = ref(null)
onMounted(initTweens)
onMounted(initMouseEvents)

function initTweens() {
  for (let path of svg.value.children) {
    const delay = Math.random()%0.9;
    const angle = Math.random()*10;
    const sign = Math.sign(Math.random()-0.5);

    gsap.timeline({
      scrollTrigger: {
        trigger: "#seconds"
      }
    })
    .from(path, {
      delay: delay,
      duration: 0.2,
      y: -500,
    })
    .from(path, {
      delay: delay+0.05,
      duration: 0.4,
      ease:"back.out(2)",
      rotate: sign*angle
    }, 0);
  }
}

function initMouseEvents () {
	for (let g of svg.value.children) {
		let hoverTween

		g.addEventListener('mouseenter', () => {
			if (hoverTween) hoverTween.kill()
			hoverTween = gsap.to(g, {
				y: 50,
				duration: 1,
				ease: "elastic.out(1, 0.5)",
			})
		})

		g.addEventListener('mouseleave', () => {
			if (hoverTween) hoverTween.kill()
			hoverTween = gsap.to(g, {
				y: 0,
				duration: 1,
				ease: "elastic.out(1, 0.5)",
			})
		})

		const productId = g.getAttribute('data-stripe-id')
		g.addEventListener('click', () => router.push(`/product/${productId}`))
	}
}
</script>

<style>
.fromunder g:hover {
	cursor: pointer;
	pointer-events: bounding-box
}
</style>

